import React from 'react';
import './Announcements.css';

function card(props){
  return (
    <div class="card" style={{width: "18rem"}}>
      <img src={props.image} class="card-img-top" alt="..."></img>
      <div class="card-body">
        <h5 class="card-title">{props.title}</h5>
        <p class="card-text">{props.message}</p>
      </div>
    </div>
  );
}

export default card;
